  const dummyData = new DummyData(req.body);

  try {
    await dummyData.save();
    res.status(201).json(dummyData);
  } catch (error) {
    res.status(400).json({ message: error.message });
  }
};

exports.findAll = async (req, res) => {
  try {
    const dummyData = await DummyData.find();
    res.json(dummyData);
  } catch (error) {
    res.status(500).json({ message: error.message });
  }
};
```

- In `server/routes/api.js`, create routes for the API:

```javascript
const express = require('express');
const router = express.Router();
const DummyDataController = require('../controllers/DummyDataController');

router.post('/', DummyDataController.create);
router.get('/', DummyDataController.findAll);

module.exports = router;
```

- In `server/index.js`, set up the Express server and routes:

```javascript
const express = require('express');
const bodyParser = require('body-parser');
const cors = require('cors');
const mongoose = require('mongoose');
const apiRoutes = require('./routes/api');

const app = express();

app.use(bodyParser.json());
app.use(cors());

mongoose.connect('mongodb://localhost/my-app-db', { useNewUrlParser: true, useUnifiedTopology: true });

app.use('/api', apiRoutes);

app.listen(3001, () => {
  console.log('Server is running on port 3001');
});
```

